                    </div>
                    <div className="form-group row">
                        <div className="col-sm-12 py-1">
                        <button type="submit" onClick={() => this.props.getSignIn()} className="btn btn-primary btn-block" data-dismiss="modal">Login</button>
                        </div>
                    </div>
                </form>
            </div>
        )
    }
}
